import './home.css';
import Img from './Notes.gif';

const Home = ()=>{
    return(
        <div className="home container-fluid p-5 row m-0">
            <h4 className="title col p-5 mx-1 fw-4">
                Your personal notes storage !!
            </h4>
            <div className="img col text-center">
                <img src={Img} alt="" />
            </div>
        </div>
    );
}

export default Home;
